import React from 'react';
import { StyleSheet, ImageBackground, View, TouchableOpacity, Text} from 'react-native';
import Input from 'react-native-input-style';

const AboutUsScreen = () => {
  return (
		<ImageBackground source={require('./../../../assets/home.jpg')} style={styles.backgroundImage}>
			<View>
			<Input
  onlyEnglish
  id="name"
  label="Full Name"
  keyboardType="default"
  required
  contain=" "
  autoCapitalize="sentences"
  errorText="Your name is invalid"
  onInputChange={YOUR_InputChangeHandler}
  initialValue=""
  outlined
  borderColor="blue"
  />

<Input
  id="password"
  label="password"
  keyboardType="default"
  secureTextEntry
  required
  submit={!isSignup && authHandler}
  minLength={6}
  maxLength={20}
  autoCapitalize="none"
  errorText="Your password is invalid"
  onInputChange={YOUR_InputChangeHandler}
  initialValue=""
  outlined
  borderColor="blue"
  />

			</View>
		</ImageBackground>
	);
}

const styles = StyleSheet.create({
	backgroundImage: {
		flex: 1,
    alignItems: 'center',
    justifyContent: 'center',
	},
});

export default AboutUsScreen;
